import React, { useState, useEffect } from 'react';
// import { getJobs } from '../../services/api'; // Example API call
import { Link } from 'react-router-dom';

const JobListingPage = () => {
  const [jobs, setJobs] = useState([]);
  const [filter, setFilter] = useState('');

  // Example: fetch jobs from backend
  useEffect(() => {
    // getJobs().then((data) => setJobs(data));
    // For demonstration, let's use static data:
    setJobs([
      { id: 1, title: 'Frontend Developer Intern', company: 'TechStart Inc.', location: 'San Francisco', type: 'Internship' },
      { id: 2, title: 'Data Science Intern', company: 'Analytics Pro', location: 'New York', type: 'Internship' },
      { id: 3, title: 'UX/UI Design Intern', company: 'Creative Solutions', location: 'Remote', type: 'Internship' },
    ]);
  }, []);

  const filteredJobs = jobs.filter((job) =>
    job.title.toLowerCase().includes(filter.toLowerCase()) ||
    job.company.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <div className="max-w-7xl mx-auto px-4 py-8">
      <h1 className="text-2xl font-bold mb-4">Find Your Perfect Internship</h1>
      <div className="flex gap-4">
        {/* Filters Section */}
        <aside className="w-1/4 hidden md:block">
          <h2 className="font-bold mb-2">Filters</h2>
          <input
            type="text"
            placeholder="Search by keyword"
            className="border w-full px-3 py-2 rounded mb-4"
            value={filter}
            onChange={(e) => setFilter(e.target.value)}
          />
          {/* Additional filter options (location, job type, etc.) */}
          <div className="mb-4">
            <h3 className="font-semibold mb-1">Job Type</h3>
            <ul className="text-sm space-y-1">
              <li><input type="checkbox" /> Internship</li>
              <li><input type="checkbox" /> Part-time</li>
              <li><input type="checkbox" /> Full-time</li>
            </ul>
          </div>
          <div className="mb-4">
            <h3 className="font-semibold mb-1">Location</h3>
            <ul className="text-sm space-y-1">
              <li><input type="checkbox" /> Remote</li>
              <li><input type="checkbox" /> Hybrid</li>
              <li><input type="checkbox" /> On-site</li>
            </ul>
          </div>
        </aside>

        {/* Jobs List */}
        <section className="w-full md:w-3/4">
          <div className="flex items-center justify-between mb-4">
            <p className="text-gray-600">Showing {filteredJobs.length} results</p>
            <select className="border px-2 py-1 rounded">
              <option>Most Recent</option>
              <option>Highest Paying</option>
              <option>Location</option>
            </select>
          </div>
          <div className="space-y-4">
            {filteredJobs.map((job) => (
              <div key={job.id} className="border rounded p-4 hover:shadow-md transition">
                <div className="flex justify-between">
                  <h3 className="font-bold text-lg">{job.title}</h3>
                  {/* Could add a "Featured" badge if needed */}
                </div>
                <p className="text-sm text-gray-600">{job.company} | {job.location}</p>
                <Link
                  to={`/jobs/${job.id}`}
                  className="mt-2 inline-block bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-500"
                >
                  Apply Now
                </Link>
              </div>
            ))}
          </div>
        </section>
      </div>
    </div>
  );
};

export default JobListingPage;
